Relationship.create([subject_id: (Resource.find_by literal: 'T0013468').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "لقد تم تغيير إسم جمهورية يوغسلافيا الاتحادية(يوغوسلافيا) إلى صربيا والجبل الأسود,اعتباراً من تاريخ 4 شباط/فبراير 2003 . وقد انفصلت جمهورية الجبل الأسود عن الاتحاد في 3 حزيران/يونية 2006 تاركة المجال لجمهورية صربيا لتعلن عن نفسها بعد ذلك بفترة قصيرة بأنها الوريث الشرعي لاتحاد صربيا والجبل الأسود.", language_id: (Language.find_by name: 'ar').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0013468').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "2003年2月4日，南斯拉夫联盟共和国（南斯拉夫）改名为塞尔维亚和黑山。2006年6月3日，黑山脱离联邦，不久塞尔维亚宣布自己为塞尔维亚和黑山联盟的合法继承者。", language_id: (Language.find_by name: 'zh').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0013468').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "The name of the Federal Republic of Yugoslavia (YUGOSLAVIA) was changed to Serbia and Montenegro as of 4 Feb. 2003.  Montenegro seceded from the federation on 3 June 2006, leaving the Republic of Serbia shortly thereafter to declare itself legal successor to the State Union of Serbia and Montenegro.", language_id: (Language.find_by name: 'en').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0013468').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "La République fédérale de Yougoslavie (YOUGOSLAVIE) a changé son nom en Serbie et Monténégro le 4 février 2003. Le Montenegro s'est ensuite détaché de la Fédération le 3 juin 2006, laissant la République de Serbie se déclarer peu après le successeur légal de l'ancien Etat de Serbie et Montenegro.", language_id: (Language.find_by name: 'fr').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0013468').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Название Федеративной Республики Югославия (ЮГОСЛАВИЯ) было изменено на \"Сербия и Черногория\" 4 февраля 2003 года. ,Черногория объявила о своем выходе из союза с Сербией с 3 июня 2006 года и объявила себя правопреемником государственного союза Сербии и Черногории.", language_id: (Language.find_by name: 'ru').id).id])
